import { Link } from "react-router-dom";

const Navbar = () => {
  // const [user, setUser] = useState(null)
  return (
    <div>
      <nav className="navbar">
        <h1>Super Shop</h1>
        <div className="links">
          <Link to="/">Home</Link>
          {user} ? (
            <>
          <Link to="/">Logout</Link>
          <Link to="/list">Shopping List</Link>
            
            </>
          )
          <Link to="/login">Login</Link>
          <Link to="/signup">Signup</Link>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
